CREATE DATABASE IF NOT EXISTS ipl_2023;

USE ipl_2023;

CREATE TABLE teams(
	id INT PRIMARY KEY,
	team_name VARCHAR(30)
); 

CREATE TABLE venues(
	id INT PRIMARY KEY,
	venue_name VARCHAR(100)
); 

CREATE TABLE players(
	id INT PRIMARY KEY,
    player_name VARCHAR(30),
    team_id INT,
    player_role VARCHAR (20),
    FOREIGN KEY (team_id) REFERENCES teams(id)
); 

CREATE TABLE match_result(
	match_number INT PRIMARY KEY,
    match_date DATE,
    venue_id INT,
    team1_id INT,
    team1_runs INT,
    team1_wickets INT,
    team1_overs DECIMAL(3, 1),
    team2_id INT,
    team2_runs INT,
    team2_wickets INT,
    team2_overs DECIMAL(3, 1),
	winner_team INT,
	home_team INT,
    result VARCHAR(30),
    player_of_match INT,
    FOREIGN KEY (venue_id) REFERENCES venues(id),
    FOREIGN KEY (team1_id) REFERENCES teams(id),
    FOREIGN KEY (team2_id) REFERENCES teams(id),
    FOREIGN KEY (winner_team) REFERENCES teams(id),
    FOREIGN KEY (home_team) REFERENCES teams(id),
    FOREIGN KEY (player_of_match) REFERENCES players(id)
); 

CREATE TABLE batting_stats(
	match_number INT,
    team_id INT,
    batter_id INT,
    runs INT,
    balls INT,
    fours INT,
    sixes INT,
    strike_rate	DECIMAL(5, 2),
    out_or_notout VARCHAR(100),
    PRIMARY KEY(match_number, batter_id),
    FOREIGN KEY (team_id) REFERENCES teams(id),
    FOREIGN KEY (batter_id) REFERENCES players(id)    
); 

CREATE TABLE bowling_stats(
	match_number INT,
    team_id INT,
    bowler_id INT,
    overs DECIMAL(2, 1),
    maidens INT,
    runs INT,
    wickets INT,
    economy DECIMAL(4, 2), 
    extras INT,
    PRIMARY KEY(match_number, bowler_id),
    FOREIGN KEY (team_id) REFERENCES teams(id),
    FOREIGN KEY (bowler_id) REFERENCES players(id)
); 

CREATE TABLE extra_runs(
	match_number INT,
    team_id INT,
    extras INT,
    byes INT,
    leg_byes INT,
    no_balls INT,
    wides INT,
    PRIMARY KEY(match_number, team_id),
    FOREIGN KEY (team_id) REFERENCES teams(id)
); 

CREATE TABLE fall_of_wickets(
	match_number INT,
    team_id INT,
    batter_id INT,
    wicket_number INT,
    score INT,
    wicket_over DECIMAL(3, 1),
    PRIMARY KEY(match_number, batter_id),
    FOREIGN KEY (team_id) REFERENCES teams(id),
    FOREIGN KEY (batter_id) REFERENCES players(id)
); 

CREATE TABLE match_stats(
	match_number INT,
    team_id INT,
    score INT,
    wickets INT,
    overs DECIMAL(3, 1),
    run_rate DECIMAL(4, 2),
    fours INT,
    sixes INT,
    extras INT,
    PRIMARY KEY(match_number, team_id),
    FOREIGN KEY (team_id) REFERENCES teams(id)
); 


